This species belongs to the plumifer species group as setae J2 and R1 are present ( Chant and McMurtry 1994 ). It is widely distributed in sub-Saharan Africa, Madagascar (
Demite et al. 2019
), in La Réunion (
Quilici et al. , 2000
;
Demite et al. 2019
) and recently from one island of the Comoros Archipelago, Grande Comore (
Kreiter et al. 2018b
).

If all details of collections were provided in the previous paper concerning La Réunion (
Quilici et al. 2000
), measurements of specimens collected and identified were not published. Measurements of specimens collected during this study are provided in table 30.
